import React, { useEffect, useState } from "react";
import "../../styles/flowTwo/ZipCodePage.css";
import Header from "../UserFlowOne/Header.js";

const ZipCodePage2 = ({ nextStep, updateFormData }) => {
  const [zipCode, setZipCode] = useState("");
  const [error, setError] = useState("");
  const [location, setLocation] = useState("California");

  useEffect(() => {
    const fetchLocation = async () => {
      try {
        const response = await fetch(
          "https://ipinfo.io?token=YOUR_ACCESS_TOKEN"
        );
        const data = await response.json();
        setLocation(data.region || "your area");
      } catch (error) {
        console.error("Error fetching location:", error);
      }
    };

    fetchLocation();
  }, []);

  const handleInputChange = (e) => {
    setZipCode(e.target.value);
    setError(""); // Clear error on input change
  };

  const handleSubmit = () => {
    if (/^\d{5}$/.test(zipCode)) {
      updateFormData("zipCode", zipCode);
      nextStep();
    } else {
      setError("Please enter a valid ZIP code.");
    }
  };

  return (
    <div>
      <Header />
      {/* Hero Section */}
      <h1>Find the lowest car insurance rates in {location}!</h1>
      <div className="hero-section">
        <header>
          <img src="/logo.png" alt="Official Car Insurance Logo" />
        </header>
        <div className="form-container">
          <label htmlFor="zipCode">What is your ZIP Code?</label>
          <input
            type="text"
            id="zipCode"
            placeholder="ZIP Code"
            value={zipCode}
            onChange={handleInputChange}
          />
          <button onClick={handleSubmit}>Start Now</button>
          {error && <p className="error-message">{error}</p>}
        </div>
      </div>

      {/* Partners Section */}
      <div className="partners">
        <h4>OUR PARTNERS</h4>
        <div className="partner-logos">
          {/* Logo Section */}
          <img
            src="https://www.allstate.com/dist/content-client-react-app/static/media/logo-large.dd47a938943f3af25de5f6885d2c39d8.svg"
            alt="Allstate Logo"
            className="logo"
          />
          <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRBdupRpyPnMb5l6Mi3Mhoz8pT0cYVck-bh6Q&s"
            alt="The General Logo"
            className="logo"
          />
          <img
            src="data:image/png;base64,"
            alt="Liberty Mutual Logo"
            className="logo"
          />
          <img
            src="https://images.contentstack.io/v3/assets/blt62d40591b3650da3/blt483e097d64d66a25/66476d224ac76ee67740f2d5/logo-progressive.svg"
            alt="Progressive Logo"
            className="logo"
          />
          <span>+25 more</span>
        </div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <div className="footer-columns">
          <div>
            <h4>Contact Us</h4>
            <p>OfficialCarInsurance.com</p>
            <p>QuoteLab, LLC</p>
            <p>700 S. Flower St., Suite 640</p>
            <p>Los Angeles, CA 90017</p>
            <p>info@mediaalpha.com</p>
          </div>
          <div>
            <h4>Links</h4>
            <a href="#">Privacy Center</a> | <a href="#">Terms of Use</a> |{" "}
            <a href="#">Your Privacy Rights</a> | <a href="#">Contact Us</a>
          </div>
        </div>
        <p>Â© 2024 OfficialCarInsurance.com. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default ZipCodePage2;
